e=A.G_('The city of Dubai is the largest and most populated city in the United Arab Emirates (UAE) and the capital city of the emirate of Dubai, UAE. The city is sometimes called "Dubai City" to prevent it from being mixed up with the emirate.\nDubai is a city and emirate in the United Arab Emirates known for luxury shopping, ultramodern architecture and a lively nightlife scene. Burj Khalifa, an 830m-tall tower, dominates the skyscraper-filled skyline. At its foot lies Dubai Fountain, with jets and lights choreographed to music. On artificial islands just offshore is Atlantis, The Palm, a resort with water and marine-animal parks.\nThere are records of the town of Dubai from 1799. The city was a dependent of Abu Dhabi until 1833. The town of Dubai was an important port of call for foreign tradesmen (chiefly Indians), who settled in the town. Until the 1930s, the town was known for its pearls.',A.iq(n,"United Arab Emirates",25.0762677,n,55.0876628,m,"West Asia"),"images/cover-dubai.jpg",l,"City in the UAE",n,e)
