p=A.za("History",j,m,a0,!1,a,A.iq("London, England","England",51.5046656,"London",-0.0893729,"Europe",e),"Tower Bridge","images/cover-tower-bridge.jpg",14.36,5,"Over 100 years ago, the Victorians built a bridge that has become one of London's most famous landmarks. High level walkway were built to allow people to cross the Thames whilst the Bridge was lifted to let tall ships sail past. Today these Walkway act as viewing galleries, giving visitors the most spectacular views across an ever changing London skyline. Completed in 1894, Tower Bridge was instantly hailed as a London icon and one of the great engineering marvels of its age. Come inside to explore its history, uncover its secrets and to enjoy stunning views from its high-level Walkway, situated 42 metres above the River Thames. The Walkway offer fantastic views of many of London's most famous sights, including St Paul's Cathedral, sky-scraping Canary Wharf, maritime Greenwich and The London Eye. Special viewing windows make photography easy.Victorian Engine Rooms house the original steam engines, awesome machines whose immense power once raised the bascules of the bridge. A \u201cvirtual bridge lift\u201d shows how the bascules still rise today to let ships pass beneath the Walkway.",p)
